using Dignite.Abp.BlobStoring.InfoPersistent;
using Dignite.Abp.BlobStoring.InfoPersistent.TestObjects;
using Shouldly;
using SixLabors.ImageSharp;
using System;
using System.Threading.Tasks;
using Volo.Abp;
using Volo.Abp.BlobStoring;
using Volo.Abp.Modularity;
using Volo.Abp.MultiTenancy;
using Volo.Abp.Testing;
using Xunit;

namespace Dignite.Abp.BlobStoring;

public abstract class BlobContainer_Tests<TStartupModule> : AbpIntegratedTest<TStartupModule>
    where TStartupModule : IAbpModule
{
    protected IBlobContainer<TestContainer1> TestContainer1 { get; }
    protected IBlobContainer<TestContainer2> TestContainer2 { get; }
    protected IBlobContainer<TestContainer3> TestContainer3 { get; }

    protected IBlobContainer<TestContainer4> ImageContainer { get; }

    protected ICurrentTenant CurrentTenant { get; }
    protected ICurrentBlobInfo CurrentBlob{get;}

    protected BlobContainer_Tests()
    {
        TestContainer1 = GetRequiredService<IBlobContainer<TestContainer1>>();
        TestContainer2 = GetRequiredService<IBlobContainer<TestContainer2>>();
        TestContainer3 = GetRequiredService<IBlobContainer<TestContainer3>>();
        ImageContainer = GetRequiredService<IBlobContainer<TestContainer4>>();
        CurrentTenant = GetRequiredService<ICurrentTenant>();
        CurrentBlob = GetRequiredService<ICurrentBlobInfo>();
    }

    protected override void SetAbpApplicationCreationOptions(AbpApplicationCreationOptions options)
    {
        options.UseAutofac();
    }

    [Fact]
    public async Task Should_No_Permission()
    {
        var blobName = "test-blob-11";

        var testContent = "test content".GetBytes();

        var testContentOverwritten = "test content overwritten".GetBytes();

        await TestContainer1.SaveAsync(blobName, testContentOverwritten);

        var stream = await TestContainer1.GetAsync(blobName);

        stream.ShouldNotBeNull();
    }

    [Fact]
    public async Task Limit_Size_Of_Blob()
    {
        var blobName = "test-blob-1";

        var testContent = "test content".GetBytes();

        await TestContainer2.SaveAsync(blobName, testContent);

        var stream = await TestContainer2.GetAsync(blobName);

        stream.ShouldNotBeNull();
    }

    [Fact]
    public async Task Constraint_Blob_File_Type()
    {
        var blobName = "test-blob-1.txt";

        var testContent = "test content".GetBytes();

        var blobInfo = new BasicBlobInfo("TestContainer3", blobName, testContent.Length, "hash", null);
        using (CurrentBlob.Current(blobInfo))
        {
            await Assert.ThrowsAsync<BusinessException>(() =>
                TestContainer3.SaveAsync(blobName, testContent)
            );
        }
    }


    [Fact]
    public async Task Resize_Image_And_Save_Blob()
    {
        var blobName = "test_image_resize.jpeg";
        var base64String = "";
        var testContent = Convert.FromBase64String(base64String);
        await ImageContainer.SaveAsync(blobName, testContent);

        var imageStream = await ImageContainer.GetAsync(blobName);

        imageStream.ShouldNotBeNull();

        using (Image image = Image.Load(imageStream))
        {
            image.Width.Equals(200).ShouldBeTrue();
        }
    }
}
